import React from 'react';
import logoImg from '../../assets/images/logo.svg'

function Landing() {
  return (
      <div id="page-landing">
          <div id="page-landing-content" className="container">
              <div className="logo-containter">
                  <img src={logoImg} alt="" />
              </div>
          </div>
      </div>
  );
}

export default Landing;
